import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

const Register = () => {
  const [formData, setFormData] = useState({
    name: '', email: '', password: '', phone: '', department: '', year: ''
  });
  const navigate = useNavigate();

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleRegister = (e) => {
    e.preventDefault();
    alert(`Registration successful for: ${formData.name}`);
    navigate('/');
  };

  return (
    <div style={styles.container}>
      <div style={styles.card}>
        <h2 style={styles.title}>Join EventHub</h2>
        <form onSubmit={handleRegister} style={styles.form}>
          <input type="text" name="name" placeholder="Full Name" value={formData.name} onChange={handleChange} style={styles.input} required />
          <input type="email" name="email" placeholder="Email" value={formData.email} onChange={handleChange} style={styles.input} required />
          <input type="password" name="password" placeholder="Password" value={formData.password} onChange={handleChange} style={styles.input} required />
          <input type="tel" name="phone" placeholder="Phone" value={formData.phone} onChange={handleChange} style={styles.input} />
          <input type="text" name="department" placeholder="Department" value={formData.department} onChange={handleChange} style={styles.input} />
          <select name="year" value={formData.year} onChange={handleChange} style={styles.input}>
            <option value="">Select Year</option>
            <option value="1st Year">1st Year</option>
            <option value="2nd Year">2nd Year</option>
            <option value="3rd Year">3rd Year</option>
            <option value="4th Year">4th Year</option>
          </select>
          <button type="submit" style={styles.button}>Create Account</button>
        </form>
        <p style={styles.link}>
          Already have an account? 
          <span style={styles.linkText} onClick={() => navigate('/login')}> Sign in</span>
        </p>
      </div>
    </div>
  );
};

const styles = {
  container: { display: 'flex', justifyContent: 'center', alignItems: 'center', minHeight: '80vh', padding: '20px' },
  card: { background: 'rgba(255,255,255,0.95)', padding: '40px', borderRadius: '15px', boxShadow: '0 20px 60px rgba(0,0,0,0.1)', maxWidth: '400px', width: '100%', textAlign: 'center' },
  title: { color: '#333', marginBottom: '30px', fontSize: '28px' },
  form: { display: 'flex', flexDirection: 'column', gap: '15px' },
  input: { padding: '12px 16px', border: '2px solid #e1e5e9', borderRadius: '8px', fontSize: '16px' },
  button: { padding: '14px', background: 'linear-gradient(135deg, #667eea, #764ba2)', color: 'white', border: 'none', borderRadius: '8px', fontSize: '16px', fontWeight: '600', cursor: 'pointer', marginTop: '10px' },
  link: { color: '#666', marginTop: '20px' },
  linkText: { color: '#667eea', cursor: 'pointer', fontWeight: '600', marginLeft: '5px' }
};

export default Register;
